"""
    abaa -> aabaa

"""
from collections import defaultdict


class Solution:
    def shortestPalindrome(self, s: str) -> str:
        MOD = 1000_000_007

        hashVals = defaultdict(list)
        pre = ""
        base = 0
        hashValue = 0
        for char in s:
            pre += char
            hashValue = (hashValue + 10**base + ord(char)) % MOD
            hashVals[hashValue] = 1
        re = "".join(reversed(s))
        suf = ""
        i = 0
        while len(re):
            reHash = hash(re)
            if reHash in hashVals:
                return suf + s
            suf += re[0]
            re = re[1:]
        return ""
